/*Table structure for table `tb_platforms` */

CREATE TABLE `tb_platforms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `platform` varchar(128) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `entry_by` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tb_platforms` */

/*Table structure for table `tb_projects` */

CREATE TABLE `tb_projects` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `description` text NOT NULL,
  `client` int(11) NOT NULL,
  `service` int(11) NOT NULL,
  `budget` int(11) NOT NULL,
  `final_budget` int(11) DEFAULT NULL,
  `status` enum('pending','ongoing','approved','delivered','invoiceable') NOT NULL,
  `date` date NOT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `assign_to` int(11) NOT NULL,
  `entry_by` int(11) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tb_projects` */

/*Table structure for table `tb_restapi` */

CREATE TABLE `tb_restapi` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `apiuser` int(11) DEFAULT NULL,
  `apikey` varchar(100) DEFAULT NULL,
  `created` date DEFAULT NULL,
  `modules` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

